import HomePage from './pages/HomePage';
import ProductPage from './pages/ProductPage';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

function App() {
  // Main App component
  return (
    <BrowserRouter>
      <div>
        <header>
          <a href="/">amazona</a> {/* This is a link */}
        </header>
        {/* Main content section */}
        <main>
          <Routes>
            <Route path="/porduct/:slug" element={<ProductPage />} />
            {/* HomePage instead of HomeScre */}
            <Route path="/" element={<HomePage />} />
          </Routes>
        </main>
      </div>
    </BrowserRouter>
  );
}
// Export the App component
export default App;
